source_string:
The following patches have been removed since the last time you used them.

${patches}

Continue anyways?

translation:
Seuraavat paikkaukset on poistettu edellisen käyttökerran jälkeen.

${patches}

Jatketaanko silti?

source_string:
The version of the app you have selected does not match the suggested version which can lead to unexpected issues. Please use the suggested version.

Selected version: ${selected}
Suggested version: ${suggested}

To continue anyway, disable "Require suggested app version" in the settings.

translation:
Valitsemasi sovellusversio ei vastaa ehdotettua versiota ja tämä voi johtaa odottamattomia ongelmia. Käytä ehdotettua sovellusversiota.

Valittu versio: v${selected}
Ehdotettu versio: v${suggested}

Ohittaaksesi tämän, ota "Vaadi ehdotettu sovellusversio" -asetus käyttöön.

source_string:
Some patches require options to be set:

${patches}

Please set them before continuing.

translation:
Joillekin paikkauksille on määritettävä asetuksia:

${patches}

Tee tarvittavat määritykset ennen kuin jatkat.

